import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import About from './About';
import Contact from './Contact';
import Services from './Services';
import Home from './Home';

function App() {
  return (
    <Router>
      <div className="App">
        <header>
          <h1 className="white-button">Yo.Raji</h1>
          <nav>
            <Link to="/about" className="white-button">About</Link>
            <Link to="/projects" className="white-button">Projects</Link>
            <Link to="/contact" className="white-button">Contact</Link>
            <Link to="/services" className="white-button">Services</Link>
            <Link to="/" className="white-button">Home</Link>
          </nav>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/services" element={<Services />} />
            <Route 
              path="/projects"
              element={
                <div>
                  <h1>Projects</h1>
                  <p>Here are some of my recent works.</p>
                </div>
              }
            />
          </Routes>
        </main>

        <footer>&copy; 2025 My Portfolio</footer>
      </div>
    </Router>
  );
}

export default App;
